import React from "react";

function Footer() {
    return (
        <div>
            <footer class="footer mt-auto py-3">
                <div class="container">
                    <span class="text-muted">Plant shop @copyright</span>
                </div>
            </footer>
        </div>
    );
}
export default Footer;
